import React, { useState } from 'react'
import './Navigation.css'

function NavigationBar() {

  const arr = [
    {
      id: 1,
      name: 'HOME'
    },
    {
      id: 2,
      name: 'ABOUT US'
    },
    {
      id: 3,
      name: 'CONTACT US'
    },
    {
      id: 4,
      name: 'PRICING'
    }
  ]

  function FirstMessage() {
    const [text, setText] = useState('Click on a button to see where you are');
  }


  return (
    <div>
      <button className='navbuttoncss'>{arr[0].name}</button>
      <button className='navbuttoncss'>{arr[1].name}</button>
      <button className='navbuttoncss'>{arr[2].name}</button>
      <button className='navbuttoncss'>{arr[3].name}</button>

      <div onLoad={FirstMessage}></div>
    </div>
  )
}

export default NavigationBar
